import React from 'react';
import './Joul.css';
import WorkTitle from './WorkTitle/WorkTitle';
import { WorkOne } from './WorkTitle/Data';
import {Helmet} from 'react-helmet';

function Joul() {
    return (
        <>
        <div>
        <WorkTitle {...WorkOne} />
        <img class="img_cover" src={"./images/joul/cover.jpg"} />
        </div>
        </>
    );
}

export default Joul;
